import React from 'react';
import { Container, Row, Col,Table } from 'react-bootstrap';

const List = () => {
    return(
        <Container>
            <h3>ข้อมูล</h3>
        <Table>
            <thead>
                <th>id</th>
                <th></th>
            </thead>
        </Table>

    </Container>
    );
}
export default List;
